const Nav = () => {
	return (
		<div className='nav'>
			<nav>
				<ul>
					<li><a>Профиль</a></li>
					<li><a>Сообщения</a></li>
					<li><a>Новости</a></li>
					<li><a>Музыка</a></li>
					<li><a>Настройки</a></li>
				</ul>
			</nav>
		</div>
	);
}

export default Nav;
